INSERT INTO `v1_4bc3928d32b703e94fcc8865ee42e06f6f28e02c44559e6f7c3f520f77d31886` VALUES (1, 1, 0, "", 1, "---", 2, 1, "", "アヤネ");
INSERT INTO `v1_4bc3928d32b703e94fcc8865ee42e06f6f28e02c44559e6f7c3f520f77d31886` VALUES (2, 3, 6000, "", 0, "---", 1, 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "アサヒ");
INSERT INTO `v1_4bc3928d32b703e94fcc8865ee42e06f6f28e02c44559e6f7c3f520f77d31886` VALUES (3, 0, 16000, "ホームランを連発すると、連発数に応じてパワーアップする", 3, "アドレナリン", 3, 1, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "部員3");
INSERT INTO `v1_4bc3928d32b703e94fcc8865ee42e06f6f28e02c44559e6f7c3f520f77d31886` VALUES (4, 2, 30000, "幸運のハプニングを呼び込む", 2, "ラッキー", 2, 1, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "{0}");
INSERT INTO `v1_4bc3928d32b703e94fcc8865ee42e06f6f28e02c44559e6f7c3f520f77d31886` VALUES (5, 1, 50000, "", 1, "", 0, 0, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", "選手名鑑 おまけページ");
